script: |
  super -f text -I q7708.spq | sort > q7708.out

inputs:
  - name: q7708.spq
    data: |
      SELECT DISTINCT - col2 / + - 31 AS col0 FROM tab2 (FORMAT parquet) WHERE + 29 NOT IN ( - 93 + - col2 + 33 * col2 / + col2 * + col0 );
  - name: tab2

outputs:
  - name: q7708.out
    data: |
      0
      1
